import React from 'react';
import Card from "./Card";
import CreateAccount from "./CreateAccount";

function Login() {
  return (
    <Card
        bgcolor="primary"
        header="Create Account"
        status={status}
        body={
            <>
                Email address<br/>
                <input type="input" className="form-control" id="email" placeholder="Enter email" value={email} onChange={handleClick}/>
                <br/>
                Password<br/>
                <input type="password" className="form-control" id="password" placeholder="Enter password" value={password} onChange={handleClick}/>
                <br/>
            </>
        }
    />
  )
}

export default Login;
